IF ANY OF CIQDPHA - CIQDPHE SELECTED THEN SKIP TO CIDDPRB;
ELSE IF ANY OF CIQDPHI - CIQDPHH SELECTED THEN SKIP TO CIQDPJ;
ELSE IF ANY OF CIQDPHI - CIQDPHJ SELECTED THEN SKIP TO CIQDPN;
ELSE IF CIQDPHK SELECTED THEN SKIP TO CIQDPQ;
ELSE IF REFUSED OR DON'T KNOW THEN SKIP TO CIDDPRB.

if any ( ) responses were coded in YDQE14--YDQE18E,
continue.<p>
All others go to YDQE20.
